import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import "./Navbar.css";

function CustomNavbar({ user, onLoginClick, onLogout, onNavigateHome, onNavigateProfile }) {
  const handleBrandClick = () => {
    if (user) {
      onNavigateProfile(); // Navigate to Profile when logged in
    } else {
      onNavigateHome(); // Navigate to Home when not logged in
    }
  };

  return (
    <Navbar className="navbar-custom" expand="lg">
      <Navbar.Brand href="#" className="navbar-brand" onClick={handleBrandClick}>
        IMS
      </Navbar.Brand>
      <Nav className="ms-auto">
        {user ? (
          // Profile icon when the user is logged in
          <button className="btn icon-btn" onClick={onLogout}>
            <img
              src="images/icons/profile/profile-icon-32.png"
              alt="Profile"
              className="icon-img"
            />
          </button>
        ) : (
          // Login/Register icon when the user is not logged in
          <button className="btn icon-btn" onClick={onLoginClick}>
            <img
              src="images/icons/loginregister/loginregister-32.png"
              alt="Login/Register"
              className="icon-img"
            />
          </button>
        )}
      </Nav>
    </Navbar>
  );
}

export default CustomNavbar;
